import React, { useEffect } from "react";

export default function Logout({ setToken }) {
    useEffect(() => {
        sessionStorage.clear();
        setToken('delete');
        return () => {
            console.log('un-mounting Logout.js');
        }
    });

    return (
        <div>Logging out...</div>
    );
}
